import React,{useState} from "react";
import './LoginStyle.css';
export const LoginForm = () =>
{
    const[FirstName,setFirstName]=useState("");
    const[LastName,setLastName]=useState("");
    const[Email,setEmail]=useState("");
    const[MobileNo,setMobileNo]=useState("");
    const[DOB,setDOB]=useState("");
    const[Address,setAddress]=useState("");

    function onClick(e)
    {
     e.preventDefault();
    }
    return(
        <form onSubmit={(onClick)}>

            <div class="front-view">
                <div class="head">
                    <div class="logo"></div>
                <img id="log" src="https://divum.in/images/logo/Divum_Logo%20SVG%20(2).svg"></img>
                    <h1><b>LOGIN FORM</b></h1>

             <div class="body">
            <label>FIRSTNAME:</label>
            <input type="text" value={FirstName} onChange={(e)=>setFirstName(e.target.value)} placeholder="Enter your firstname"></input><br></br><br></br>
            <label>LASTNAME :</label>
            <input type="text" value={LastName} onChange={(e)=>setLastName(e.target.value)} placeholder="Enter your lastname"></input><br></br><br></br>
            <label>EMAIL :</label>
            <input type="text" value={Email} onChange={(e)=>setEmail(e.target.value)} placeholder="Enter your email"></input><br></br><br></br>
            <label>MOBILENUMBER :</label>
            <input type="text" value={MobileNo} onChange={(e)=>setEmail(e.target.value)} placeholder="Enter your MobileNo"></input><br></br><br></br>
            <label>DOB :</label>
            <input type="text" value={DOB} onChange={(e)=>setEmail(e.target.value)} placeholder="Enter your DOB"></input><br></br><br></br>
            <label>ADDRESS :</label>
            <input type="text" value={Address} onChange={(e)=>setEmail(e.target.value)} placeholder="Enter your Address"></input><br></br><br></br>
            <div class="btn">
            <button type="submit">SUBMIT</button>
                 </div>
            </div>
            </div>  
            </div>
            </form>
    )
}
